(351000, 4, 0, "Thank... you...", 14, 0, 100.0, 0, 0, 8870, 39601, 0, "thaddius SAY_DEATH (Naxx 40)"),
(351000, 5, 0, "Hurry! Ple-e-ase hurry!!", 14, 0, 100.0, 0, 0, 8873, 13092, 0, "thaddius SAY_SCREAM1 (Naxx 40)"),
(351000, 5, 1, "Sto-o-op! Make it stop!!", 14, 0, 100.0, 0, 0, 8874, 13093, 0, "thaddius SAY_SCREAM2 (Naxx 40)"),
