(351001, 0, 0, "Stalagg crush you!", 14, 0, 100.0, 0, 0, 8864, 13083, 0, "stalagg SAY_STAL_AGGRO (Naxx 40)"),
(351001, 1, 0, "Stalagg kill!", 14, 0, 20.0, 0, 0, 8866, 13085, 0, "stalagg SAY_STAL_SLAY (Naxx 40)"),
