(351004, 3, 0, "%s devours all nearby zombies!", 16, 0, 100.0, 0, 0, 0, 12348, 1, "Gluth - devours all (Naxx 40)"),
(351004, 4, 0, "%s goes into a berserker rage!", 41, 0, 100.0, 0, 0, 0, 34057, 1, "Gluth - berserker (Naxx 40)"),
(351005, 0, 0, "You are mine now.", 14, 0, 100.0, 0, 0, 8825, 13041, 0, "heigan SAY_AGGRO1 (Naxx 40)"),
(351005, 0, 1, "I see you!", 14, 0, 100.0, 0, 0, 8826, 73351, 0, "heigan SAY_AGGRO2 (Naxx 40)"),
(351005, 0, 2, "You... are next.", 14, 0, 100.0, 0, 0, 8827, 13043, 0, "heigan SAY_AGGRO3 (Naxx 40)"),
(351005, 1, 0, "Close your eyes. Sleep.", 14, 0, 20.0, 0, 0, 8829, 13045, 0, "heigan SAY_SLAY (Naxx 40)"),
(351005, 2, 0, "The races of the world will perish. It is only a matter of time.", 14, 0, 100.0, 0, 0, 8830, 13046, 0, "heigan SAY_TAUNT1 (Naxx 40)"),
(351005, 2, 1, "I see endless suffering. I see torment. I see rage. I see everything...", 14, 0, 100.0, 0, 0, 8831, 13047, 0, "heigan SAY_TAUNT2 (Naxx 40)"),
(351005, 2, 2, "Soon the world will tremble.", 14, 0, 100.0, 0, 0, 8832, 13048, 0, "heigan SAY_TAUNT3 (Naxx 40)"),
(351005, 2, 3, "Hungry worms will feast on your rotting flesh.", 14, 0, 100.0, 0, 0, 8834, 13050, 0, "heigan SAY_TAUNT4 (Naxx 40)"),
(351005, 3, 0, "%s takes his last breath.", 16, 0, 100.0, 0, 0, 8828, 13044, 0, "heigan EMOTE_DEATH (Naxx 40)"),
(351005, 4, 0, "%s teleports and begins to channel a spell!", 41, 0, 100.0, 0, 0, 0, 32332, 3, "Heigan EMOTE_DANCE (Naxx 40)"),
(351005, 5, 0, "%s rushes to attack once more!", 41, 0, 100.0, 0, 0, 0, 32333, 3, "Heigan EMOTE_DANCE_END (Naxx 40)"),
(351005, 6, 0, "The end is upon you.", 14, 0, 100.0, 0, 0, 8833, 13049, 0, "heigan SAY_DANCE (Naxx 40)"),
(351006, 0, 0, "Spiderlings appear on the web!", 41, 0, 100.0, 0, 0, 0, 32305, 3, "Maexxna EMOTE_SPIDERS (Naxx 40)"),
(351006, 1, 0, "%s spins her web into a cocoon!", 41, 0, 100.0, 0, 0, 0, 32303, 3, "Maexxna EMOTE_WEB_WRAP (Naxx 40)"),
(351006, 2, 0, "%s sprays strands of web everywhere!", 41, 0, 100.0, 0, 0, 0, 32304, 3, "Maexxna EMOTE_WEB_SPRAY (Naxx 40)"),
(351007, 0, 0, "Your old lives, your mortal desires mean nothing... you are acolytes of the master now, and you will serve the cause without question! The greatest glory is to die in the master's service!", 14, 0, 100.0, 0, 0, 8799, 12852, 0, "faerlina SAY_GREET (Naxx 40)"),
(351007, 1, 0, "Slay them in the master's name!", 14, 0, 100.0, 0, 0, 8794, 12856, 0, "faerlina SAY_AGGRO (Naxx 40)"),
(351007, 2, 0, "You have failed!", 14, 0, 16.0, 0, 0, 8800, 20094, 0, "faerlina SAY_SLAY1 (Naxx 40)"),
(351007, 2, 1, "Pathetic wretch!", 14, 0, 16.0, 0, 0, 8801, 12855, 0, "faerlina SAY_SLAY2 (Naxx 40)"),
(351007, 3, 0, "The master will avenge me!!", 14, 0, 100.0, 0, 0, 8798, 12853, 0, "faerlina SAY_DEATH (Naxx 40)"),
(351007, 4, 0, "%s is affected by Widow's Embrace!", 41, 0, 100.0, 0, 0, 0, 31019, 3, "Faerlina EMOTE_WIDOW_EMBRACE (Naxx 40)"),
(351007, 5, 0, "%s goes into a frenzy!", 41, 0, 100.0, 0, 0, 0, 2384, 3, "Faerlina EMOTE_FRENZY (Naxx 40)"),
(351007, 6, 0, "You cannot hide from me!", 14, 0, 100.0, 0, 0, 8795, 12857, 0, "faerlina SAY_ENRAGE1 (Naxx 40)"),
(351007, 6, 1, "Kneel before me, worm!", 14, 0, 100.0, 0, 0, 8796, 12858, 0, "faerlina SAY_ENRAGE2 (Naxx 40)"),
(351007, 6, 2, "Run while you still can!", 14, 0, 100.0, 0, 0, 8797, 61582, 0, "faerlina SAY_ENRAGE3 (Naxx 40)"),
(351008, 0, 0, "Glory to the master!", 14, 0, 100.0, 0, 0, 8845, 13061, 0, "noth SAY_AGGRO1 (Naxx 40)"),
(351008, 0, 1, "Your life is forfeit!", 14, 0, 100.0, 0, 0, 8846, 29730, 0, "noth SAY_AGGRO2 (Naxx 40)"),
(351008, 0, 2, "Die, trespasser!", 14, 0, 100.0, 0, 0, 8847, 13063, 0, "noth SAY_AGGRO3 (Naxx 40)"),
(351008, 1, 0, "Rise, my soldiers! Rise and fight once more!", 14, 0, 100.0, 0, 0, 8851, 13067, 0, "noth SAY_SUMMON (Naxx 40)"),
(351008, 2, 0, "My task is done!", 14, 0, 20.0, 0, 0, 8849, 29070, 0, "noth SAY_SLAY1 (Naxx 40)"),
(351008, 2, 1, "Breathe no more!", 14, 0, 20.0, 0, 0, 8850, 31472, 0, "noth SAY_SLAY2 (Naxx 40)"),
(351008, 3, 0, "I will serve the master... in death!", 14, 0, 100.0, 0, 0, 8848, 13064, 0, "noth SAY_DEATH (Naxx 40)"),
