(351008, 7, 0, "%s teleports back into the battle!", 41, 0, 100.0, 0, 0, 0, 32976, 3, "Noth EMOTE_TELEPORT_2 (Naxx 40)"),
(351008, 8, 0, "%s blinks away!", 41, 0, 100.0, 0, 0, 0, 32978, 3, "Noth EMOTE_BLINK (Naxx 40)"),
(351009, 0, 0, "Just a little taste...", 14, 0, 100.0, 0, 0, 8785, 13000, 0, "anubrekhan SAY_AGGRO1 (Naxx 40)"),
(351009, 0, 1, "There is no way out.", 14, 0, 100.0, 0, 0, 8786, 13002, 0, "anubrekhan SAY_AGGRO2 (Naxx 40)"),
(351009, 0, 2, "Yes, run! It makes the blood pump faster!", 14, 0, 100.0, 0, 0, 8787, 13003, 0, "anubrekhan SAY_AGGRO3 (Naxx 40)"),
(351009, 1, 0, "Ahh... welcome to my parlor.", 14, 0, 100.0, 0, 0, 8788, 13004, 0, "anubrekhan SAY_GREET1 (Naxx 40)"),
(351009, 1, 1, "I hear little hearts beating. Yes... beating faster now... soon the beating will stop.", 14, 0, 100.0, 0, 0, 8790, 13006, 0, "anubrekhan SAY_GREET2 (Naxx 40)"),
(351009, 1, 2, "Where to go? What to do? So many choices that all end in pain, end in death.", 14, 0, 100.0, 0, 0, 8791, 13007, 0, "anubrekhan SAY_GREET3 (Naxx 40)"),
(351009, 1, 3, "Which one shall I eat first? So difficult to choose. They all smell so delicious...", 14, 0, 100.0, 0, 0, 8792, 13008, 0, "anubrekhan SAY_GREET4 (Naxx 40)"),
(351009, 1, 4, "Closer now. Tasty morsels. I've been too long without food, without blood to drink.", 14, 0, 100.0, 0, 0, 8793, 13009, 0, "anubrekhan SAY_GREET5 (Naxx 40)"),
(351009, 2, 0, "Shhh... it will all be over soon.", 14, 0, 100.0, 0, 0, 8789, 13005, 0, "anubrekhan SAY_SLAY (Naxx 40)"),
(351009, 3, 0, "Anub'Rekhan begins to unleash an insect swarm!", 41, 0, 100.0, 0, 0, 0, 13443, 3, "Anub'Rekhan EMOTE_LOCUST (Naxx 40)"),
(351014, 0, 0, "%s goes into a frenzy!", 16, 0, 100.0, 0, 0, 0, 38630, 0, "Crypt Reaver (Naxx 40)"),
(351018, 0, 0, "Sapphiron lifts off into the air!", 41, 0, 100.0, 0, 0, 0, 32801, 3, "Sapphiron EMOTE_AIR_PHASE (Naxx 40)"),
