(351018, 2, 0, "%s takes a deep breath.", 41, 0, 100.0, 0, 0, 0, 24548, 3, "Sapphiron EMOTE_BREATH (Naxx 40)"),
(351018, 3, 0, "%s enrages!", 41, 0, 100.0, 0, 0, 0, 0, 3, "Sapphiron EMOTE_ENRAGE (Naxx 40)"),
(351019, 0, 0, "Your forces are nearly marshaled to strike back against your enemies, my liege.", 14, 0, 100.0, 0, 0, 14467, 12990, 3, "kelthuzad SAY_SAPP_DIALOG1 (Naxx 40)"),
(351019, 1, 0, "It is good that you serve me so faithfully. Soon, all will serve the Lich King and in the end, you shall be rewarded...so long as you do not falter.", 14, 0, 100.0, 0, 0, 8881, 0, 0, "kelthuzad SAY_SAPP_DIALOG2_LICH (Naxx 40)"),
(351019, 2, 0, "Yes, master. The time of their ultimate demise draws close.... What is this?", 14, 0, 100.0, 0, 0, 14468, 12991, 3, "kelthuzad SAY_SAPP_DIALOG3 (Naxx 40)"),
(351019, 3, 0, "Your security measures have failed! See to this interruption immediately!", 14, 0, 100.0, 0, 0, 8882, 0, 0, "kelthuzad SAY_SAPP_DIALOG4_LICH (Naxx 40)"),
(351019, 4, 0, "As you command, master!", 14, 0, 100.0, 0, 0, 14469, 12992, 3, "kelthuzad SAY_SAPP_DIALOG5 (Naxx 40)"),
(351019, 5, 0, "No!!! A curse upon you, interlopers! The armies of the Lich King will hunt you down. You will not escape your fate...", 14, 0, 100.0, 0, 0, 14484, 13150, 3, "kelthuzad SAY_CAT_DIED (Naxx 40)"),
(351019, 6, 0, "Who dares violate the sanctity of my domain? Be warned, all who trespass here are doomed.", 14, 0, 100.0, 0, 0, 14463, 0, 0, "kelthuzad SAY_TAUNT1 (Naxx 40)"),
(351019, 6, 1, "Fools! You think yourselves triumphant? You have only taken one step closer to the abyss!", 14, 0, 100.0, 0, 0, 14464, 0, 0, "kelthuzad SAY_TAUNT2 (Naxx 40)"),
(351019, 6, 2, "I grow tired of these games. Proceed, and I will banish your souls to oblivion!", 14, 0, 100.0, 0, 0, 14465, 0, 0, "kelthuzad SAY_TAUNT3 (Naxx 40)"),
(351019, 6, 3, "You have no idea what horrors lie ahead. You have seen nothing! The frozen heart of Naxxramas awaits you!", 14, 0, 100.0, 0, 0, 14466, 0, 0, "kelthuzad SAY_TAUNT4 (Naxx 40)"),
(351019, 7, 0, "Pray for mercy!", 14, 0, 100.0, 0, 0, 14475, 12995, 0, "kelthuzad SAY_AGGRO1 (Naxx 40)"),
(351019, 7, 1, "Scream your dying breath!", 14, 0, 100.0, 0, 0, 14476, 12996, 0, "kelthuzad SAY_AGGRO2 (Naxx 40)"),
(351019, 7, 2, "The end is upon you!", 14, 0, 100.0, 0, 0, 14477, 12997, 0, "kelthuzad SAY_AGGRO3 (Naxx 40)"),
(351019, 8, 0, "The dark void awaits you!", 14, 0, 100.0, 0, 0, 14478, 13021, 0, "kelthuzad SAY_SLAY1 (Naxx 40)"),
(351019, 8, 1, "%s cackles maniacally.", 16, 0, 100.0, 0, 0, 14479, 29805, 0, "kelthuzad SAY_SLAY2 (Naxx 40)"),
(351019, 9, 0, "Agghhhh! Do... not... rejoice! Your victory is a hollow one, for I shall return with powers beyond your imagining!", 14, 0, 100.0, 0, 0, 14480, 13019, 0, "kelthuzad SAY_DEATH (Naxx 40)"),
(351019, 10, 0, "Your soul is bound to me, now!", 14, 0, 100.0, 0, 0, 14472, 13017, 0, "kelthuzad SAY_CHAIN1 (Naxx 40)"),
(351019, 10, 1, "There will be no escape!", 14, 0, 100.0, 0, 0, 14473, 13018, 0, "kelthuzad SAY_CHAIN2 (Naxx 40)"),
(351019, 11, 0, "I will freeze the blood in your veins!", 14, 0, 100.0, 0, 0, 14474, 13020, 0, "kelthuzad SAY_FROST_BLAST (Naxx 40)"),
(351019, 12, 0, "Master, I require aid!", 14, 0, 100.0, 0, 0, 14470, 12998, 0, "kelthuzad SAY_REQUEST_AID (Naxx 40)"),
