(351019, 18, 0, "I grow tired of these games. Proceed, and I will banish your souls to oblivion!", 14, 0, 100.0, 0, 0, 14465, 12986, 3, "kelthuzad SAY_TAUNT3 (Naxx 40)"),
(351019, 19, 0, "You have no idea what horrors lie ahead. You have seen nothing! The frozen heart of Naxxramas awaits you!", 14, 0, 100.0, 0, 0, 14466, 27382, 3, "kelthuzad SAY_TAUNT4 (Naxx 40)"),
(351019, 20, 0, "Come, heroes... By the will of the Lich King, you shall be destroyed.", 14, 0, 100.0, 0, 0, 0, 12993, 3, "Kel'Thuzad SAY_DIALOGUE_SAPPHIRON_KELTHUZAD4 (Naxx 40)"),
(351020, 0, 0, "An aura of necrotic energy blocks all healing!", 41, 0, 100.0, 0, 0, 0, 32334, 0, "Loatheb (Naxx 40)"),
(351020, 1, 0, "The aura fades away, allowing healing once more!", 41, 0, 100.0, 0, 0, 0, 32335, 0, "Loatheb (Naxx 40)"),
(351020, 2, 0, "The aura's power begins to wane!", 41, 0, 100.0, 0, 0, 0, 32805, 0, "Loatheb (Naxx 40)"),
(351028, 0, 0, "Patchwerk want to play!", 14, 0, 100.0, 0, 0, 8909, 13068, 0, "patchwerk SAY_AGGRO1 (Naxx 40)"),
(351028, 0, 1, "Kel'thuzad make Patchwerk his avatar of war!", 14, 0, 100.0, 0, 0, 8910, 13069, 0, "patchwerk SAY_AGGRO2 (Naxx 40)"),
(351028, 1, 0, "No more play?", 14, 0, 100.0, 0, 0, 8912, 28241, 0, "patchwerk SAY_SLAY (Naxx 40)"),
(351028, 2, 0, "What... happen to-", 14, 0, 100.0, 0, 0, 8911, 13070, 0, "patchwerk SAY_DEATH (Naxx 40)"),
(351028, 3, 0, "%s goes into a berserker rage!", 16, 0, 100.0, 0, 0, 0, 4428, 0, "patchwerk EMOTE_BERSERK (Naxx 40)"),
(351028, 4, 0, "%s goes into a frenzy!", 41, 0, 100.0, 0, 0, 0, 38630, 0, "patchwerk EMOTE_ENRAGE (Naxx 40)"),
(351035, 0, 0, "Foolishly you have sought your own demise.", 14, 0, 100.0, 0, 0, 8807, 13030, 3, "Gothik SAY_INTRO_1 (Naxx 40)"),
(351035, 1, 0, "Brazenly you have disregarded powers beyond your understanding.", 14, 0, 100.0, 0, 0, 0, 13031, 3, "Gothik SAY_INTRO_2 (Naxx 40)"),
(351035, 2, 0, "You have fought hard to invade the realm of the harvester.", 14, 0, 100.0, 0, 0, 0, 13032, 3, "Gothik SAY_INTRO_3 (Naxx 40)"),
(351035, 3, 0, "Now there is only one way out- to walk the lonely path of the damned.", 14, 0, 100.0, 0, 0, 0, 13033, 3, "Gothik SAY_INTRO_4 (Naxx 40)"),
(351035, 4, 0, "I have waited long enough. Now you face the harvester of souls.", 14, 0, 100.0, 0, 0, 8808, 13028, 3, "Gothik SAY_PHASE_TWO (Naxx 40)"),
(351035, 5, 0, "I... am... undone.", 14, 0, 100.0, 0, 0, 8805, 13026, 3, "Gothik SAY_DEATH (Naxx 40)"),
(351035, 6, 0, "Death is the only escape!", 14, 0, 20.0, 0, 0, 8806, 13027, 3, "Gothik SAY_KILL (Naxx 40)"),
(351035, 7, 0, "%s teleports into the fray!", 41, 0, 100.0, 0, 0, 0, 32306, 3, "Gothik EMOTE_PHASE_TWO (Naxx 40)"),
(351035, 8, 0, "The central gate opens!", 41, 0, 100.0, 0, 0, 0, 32307, 3, "Gothik EMOTE_GATE_OPENED (Naxx 40)"),
(351036, 0, 0, "Do as I taught you!", 14, 0, 25.0, 0, 0, 8855, 13075, 3, "Razuvious SAY_AGGRO #1 (Naxx 40)"),
(351036, 0, 1, "The time for practice is over! Show me what you have learned!", 14, 0, 25.0, 0, 0, 8859, 13078, 3, "Razuvious SAY_AGGRO #2 (Naxx 40)"),
(351036, 0, 2, "Show them no mercy!", 14, 0, 25.0, 0, 0, 8856, 13076, 3, "Razuvious SAY_AGGRO #3 (Naxx 40)"),
(351036, 0, 3, "Sweep the leg... Do you have a problem with that?", 14, 0, 25.0, 0, 0, 8861, 13080, 3, "Razuvious SAY_AGGRO #4 (Naxx 40)"),
(351036, 1, 0, "%s lets loose a triumphant shout.", 16, 0, 50.0, 0, 0, 8863, 13082, 3, "Razuvious SAY_SLAY #1 (Naxx 40)"),
(351036, 1, 1, "You should have stayed home.", 14, 0, 50.0, 0, 0, 8862, 13081, 3, "Razuvious SAY_SLAY #2 (Naxx 40)"),
(351036, 2, 0, "Hah hah, I'm just getting warmed up!", 14, 0, 20.0, 0, 0, 8852, 13072, 3, "Razuvious SAY_TAUNTED #1 (Naxx 40)"),
(351036, 2, 1, "Stand and fight!", 14, 0, 20.0, 0, 0, 8853, 13073, 3, "Razuvious SAY_TAUNTED #2 (Naxx 40)"),
(351036, 2, 2, "Show me what you've got!", 14, 0, 20.0, 0, 0, 8854, 13074, 3, "Razuvious SAY_TAUNTED #3 (Naxx 40)"),
(351036, 2, 3, "You disappoint me, students!", 14, 0, 20.0, 0, 0, 8858, 13077, 3, "Razuvious SAY_TAUNTED #4 (Naxx 40)"),
(351036, 2, 4, "You should have stayed home.", 14, 0, 20.0, 0, 0, 8862, 13081, 3, "Razuvious SAY_TAUNTED #5 (Naxx 40)"),
(351036, 3, 0, "An honorable... death.", 14, 0, 100.0, 0, 0, 8860, 13079, 3, "Razuvious SAY_DEATH (Naxx 40)"),
(351038, 0, 0, "Flee, before it's too late!", 14, 0, 100.0, 0, 0, 8913, 13097, 0, "zeliek SAY_ZELI_AGGRO (Naxx 40)"),
(351038, 1, 0, "Invaders, cease this foolish venture at once! Turn away while you still can!", 14, 0, 100.0, 0, 0, 8917, 0, 0, "zeliek SAY_ZELI_TAUNT1 (Naxx 40)"),
(351038, 1, 1, "Perhaps they will come to their senses, and run away as fast as they can!", 14, 0, 100.0, 0, 0, 8918, 0, 0, "zeliek SAY_ZELI_TAUNT2 (Naxx 40)"),
(351038, 1, 2, "Do not continue! Turn back while there's still time!", 14, 0, 100.0, 0, 0, 8919, 13103, 0, "zeliek SAY_ZELI_TAUNT3 (Naxx 40)"),
(351038, 2, 0, "I have no choice but to obey!", 14, 0, 100.0, 0, 0, 8916, 13100, 0, "zeliek SAY_ZELI_SPECIAL (Naxx 40)"),
(351038, 3, 0, "Forgive me!", 14, 0, 30.0, 0, 0, 8915, 13099, 0, "zeliek SAY_ZELI_SLAY (Naxx 40)"),
(351038, 4, 0, "It is... as it should be. ", 14, 0, 100.0, 0, 0, 8914, 13098, 0, "zeliek SAY_ZELI_DEATH (Naxx 40)"),
(351038, 5, 0, "Invaders, cease this foolish venture at once! Turn away while you still can!", 14, 0, 100.0, 0, 0, 8917, 13101, 3, "zeliek SAY_ZELI_TAUNT1 (Naxx 40)"),
(351038, 6, 0, "Perhaps they will come to their senses... and run away as fast as they can.", 14, 0, 100.0, 0, 0, 8918, 13102, 3, "zeliek SAY_ZELI_TAUNT2 (Naxx 40)"),
(351038, 7, 0, "%s casts Condemnation on everyone!", 41, 0, 100.0, 0, 0, 0, 33088, 3, "zeliek EMOTE_RAGECAST (Naxx 40)"),
(351039, 0, 0, "C'mon an' fight ye wee ninny!", 14, 0, 100.0, 0, 0, 8899, 13034, 0, "korthazz SAY_KORT_AGGRO (Naxx 40)"),
(351039, 1, 0, "To arms, ye roustabouts! We've got company!", 14, 0, 100.0, 0, 0, 8903, 0, 0, "korthazz SAY_KORT_TAUNT1 (Naxx 40)"),
(351039, 1, 1, "I heard about enough of yer sniveling. Shut yer fly trap 'afore I shut it for ye!", 14, 0, 100.0, 0, 0, 8904, 0, 0, "korthazz SAY_KORT_TAUNT2 (Naxx 40)"),
(351039, 1, 2, "I'm gonna' enjoy killin' these slack-jawed daffodils!", 14, 0, 100.0, 0, 0, 8905, 13040, 0, "korthazz SAY_KORT_TAUNT3 (Naxx 40)"),
(351039, 2, 0, "I like my meat extra crispy!", 14, 0, 100.0, 0, 0, 8902, 13037, 0, "korthazz SAY_KORT_SPECIAl (Naxx 40)"),
(351039, 3, 0, "Next time, bring more friends!", 14, 0, 30.0, 0, 0, 8901, 13036, 0, "korthazz SAY_KORT_SLAY (Naxx 40)"),
(351039, 4, 0, "What a bloody waste this is!", 14, 0, 100.0, 0, 0, 8900, 13035, 0, "korthazz SAY_KORT_DEATH (Naxx 40)"),
(351039, 5, 0, "To arms, ye roustabouts! We've got company!", 14, 0, 100.0, 0, 0, 8903, 13038, 3, "korthazz SAY_KORT_TAUNT1 (Naxx 40)"),
(351039, 6, 0, "I've heard about enough a' yer snivelin'! Shut yer flytrap before I shut it for ye'!", 14, 0, 100.0, 0, 0, 8904, 13039, 3, "korthazz SAY_KORT_TAUNT2 (Naxx 40)"),
(351040, 0, 0, "Defend yourself!", 14, 0, 100.0, 0, 0, 8892, 13010, 0, "blaumeux SAY_BLAU_AGGRO (Naxx 40)"),
(351040, 1, 0, "Come, Zeliek, do not drive them out. Not before we've had our fun.", 14, 0, 100.0, 0, 0, 8896, 0, 0, "blaumeux SAY_BLAU_TAUNT1 (Naxx 40)"),
(351040, 1, 1, "I do hope they stay alive long enough for me to... introduce myself.", 14, 0, 100.0, 0, 0, 8897, 0, 0, "blaumeux SAY_BLAU_TAUNT2 (Naxx 40)"),
(351040, 1, 2, "The first kill goes to me! Anyone care to wager?", 14, 0, 100.0, 0, 0, 8898, 13016, 0, "blaumeux SAY_BLAU_TAUNT3 (Naxx 40)"),
(351040, 2, 0, "Your life is mine!", 14, 0, 100.0, 0, 0, 8895, 13013, 0, "blaumeux SAY_BLAU_SPECIAL (Naxx 40)"),
(351040, 3, 0, "Who's next?", 14, 0, 30.0, 0, 0, 8894, 21654, 0, "blaumeux SAY_BLAU_SLAY (Naxx 40)"),
(351040, 4, 0, "Touche...", 14, 0, 100.0, 0, 0, 8893, 13011, 0, "blaumeux SAY_BLAU_DEATH (Naxx 40)"),
(351040, 5, 0, "Come, Zeliek, do not drive them out. Not before we've had our fun!", 14, 0, 100.0, 0, 0, 8896, 13014, 3, "blaumeux SAY_BLAU_TAUNT1 (Naxx 40)"),
(351040, 6, 0, "I do hope they stay alive long enough for me to... introduce myself.", 14, 0, 100.0, 0, 0, 8897, 13015, 3, "blaumeux SAY_BLAU_TAUNT2 (Naxx 40)"),
(351040, 7, 0, "%s casts Unyielding Pain on everyone!", 41, 0, 100.0, 0, 0, 0, 33087, 3, "blaumeux EMOTE_RAGECAST (Naxx 40)"),
(351065, 0, 0, "%s goes into a frenzy!", 16, 0, 100.0, 0, 0, 0, 38630, 0, "Infectious Ghoul (Naxx 40)"),
(351076, 0, 0, "%s flees after seeing Kel'Thuzad fall!", 16, 0, 100.0, 0, 0, 0, 12391, 3, "Guardian of Icecrown EMOTE_FLEE (Naxx 40)"),
(351076, 1, 0, "A Guardian of Icecrown enters the fight!", 41, 0, 100.0, 0, 0, 0, 32804, 3, "Guardian of Icecrown EMOTE_APPEAR (Naxx 40)"),
(351078, 0, 0, "%s goes into a frenzy!", 16, 0, 100.0, 0, 0, 0, 38630, 0, "Plagued Ghoul (Naxx 40)"),
(351082, 0, 0, "%s goes into a frenzy!", 16, 0, 100.0, 0, 0, 0, 1191, 3, "Crypt Guard EMOTE_FRENZY (Naxx 40)"),
(351082, 1, 0, "A Crypt Guard joins the fight!", 41, 0, 100.0, 0, 0, 0, 29887, 3, "Crypt Guard EMOTE_SPAWN (Naxx 40)"),
(351082, 2, 0, "Corpse Scarabs appear from a Crypt Guard's corpse!", 41, 0, 100.0, 0, 0, 0, 32796, 3, "Crypt Guard EMOTE_SCARAB (Naxx 40)"),
(351084, 0, 0, 'Sir, student requests that you beat him for his lack of understanding!', 12, 0, 100, 1, 0, 0, 13140, 0, 'Death Knight Understudy SAY_BEAT_ME'),
(351084, 0, 1, 'I am unworthy, master!', 12, 0, 100, 1, 0, 0, 13138, 0, 'Death Knight Understudy SAY_UNWORTHY'),
(351084, 0, 2, 'Student is worthless, master! Student apologizes for his deficiency!',   12, 0, 100, 1, 0, 0, 13137, 0, 'Death Knight Understudy SAY_WORTHLESS'),
(351084, 0, 3, 'Student will work harder, master!',   12, 0, 100, 1, 0, 0, 13139, 0, 'Death Knight Understudy SAY_WORK_HARDER'),   
(351037, 0, 0, "You seek death?", 14, 0, 100, 0, 0, 8835, 13051, 0, 'mograine SAY_MOG_AGGRO_1 (Naxx 40)'),
(351037, 0, 1, "None shall pass!", 14, 0, 100, 0, 0, 8836, 13052, 0, 'mograine SAY_MOG_AGGRO_2 (Naxx 40)'),
(351037, 0, 2, "Be still!", 14, 0, 100, 0, 0, 8837, 13052, 0, 'mograine SAY_MOG_AGGRO_3 (Naxx 40)'),
(351037, 3, 0, "You will find no peace in death.", 14, 0, 30, 0, 0, 8839, 13055, 0, 'mograine SAY_MOG_SLAY_1 (Naxx 40)'),
(351037, 3, 1, "The master's will is done.", 14, 0, 30, 0, 0, 8840, 13056, 0, 'mograine SAY_MOG_SLAY_2 (Naxx 40)'),
(351037, 2, 0, "Bow to the might of the Highlord!", 14, 0, 100, 0, 0, 8841, 13057, 0, 'mograine SAY_MOG_SPECIAL (Naxx 40)'),
(351037, 1, 0, "Enough prattling. Let them come. We shall grind their bones to dust.", 14, 0, 100, 0, 0, 8842, 13058, 3, 'mograine SAY_MOG_TAUNT1 (Naxx 40)'),
(351037, 1, 1, "Conserve your anger. Harness your rage. You will all have outlets for your frustrations soon enough.", 14, 0, 100, 0, 0, 8843, 13059, 3, 'mograine SAY_MOG_TAUNT2 (Naxx 40)'),
(351037, 4, 0, "I... am... released... perhaps it's not too late to- No! I need... more... time...", 14, 0, 100, 0, 0, 8838, 13054, 0, 'mograine SAY_MOG_DEATH (Naxx 40)');
